import React, { Component, Fragment } from 'react'
//import { Link, withRouter } from 'react-router-dom'
import {
  AppBar, Toolbar, IconButton, Typography, Hidden,
  Drawer, CssBaseline, MenuList, MenuItem
} from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import { Menu } from '@material-ui/icons'
import { compose } from 'recompose'
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

const drawerWidth = 240

const styles = theme => ({
  root: {
    flexGrow: 1,
    zIndex: 1,
    overflow: 'hidden',
    position: 'relative',
    display: 'flex',
    width: '100%',
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
  },
  navIconHide: {
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
    [theme.breakpoints.up('md')]: {
      position: 'relative',
    },

  },
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3),
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
  drawer:{
    width: drawerWidth,
    flexShrink: 0,
  }
})
//const classes = styles();
class Sidebar extends Component {
  state = {
    mobileOpen: false,
    currentTab:"Home"
  }

  handleDrawerToggle = () => {
    this.setState({ mobileOpen: !this.state.mobileOpen })
  }
  handleonClick(id){
   // this.setState({currentTab:{event}})
   console.log(id);
   console.log('hello');
  }
  render() {
   // console.log(this.props);
    const { classes } = this.props;
   // console.log(classes);
    const { mobileOpen } = this.state





    return (
      <div>
      <CssBaseline/>

      <div className={styles.root}>
      <AppBar position="fixed" className={styles.appBar}>
        <Toolbar>
          <Typography variant="h6" noWrap>
          Your Dashboard
          </Typography>
        </Toolbar>
      </AppBar>

      <Drawer
        className={styles.drawer}
        variant="permanent"
        classes={{
          paper: styles.drawerPaper,
        }}
      >
        <div className={styles.toolbar} />
        <List>
          {['Home', 'Select Outlet', 'Edit Profile', 'Transaction History','Payment History'].map((text, index) => (
            <ListItem button key={text} onClick={() => this.handleonClick(text)}>

              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Drawer>




        <main className={styles.content}>
          <div className={styles.toolbar} />

        </main>
      </div>
      </div>);

  }
}

export default Sidebar;
